import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";

export default function Expenses(props) {
  return (
    <Card className="expenses">
      {props.data.map((element) => {
        return (
          <ExpenseItem
            title={element.title}
            date={element.date}
            amount={element.amount}
          ></ExpenseItem>
        );
      })}
    </Card>
  );
}
